import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';


const Note =()=>
{

    return(
      <>
      <div className="note">
      <h1>{props.title}</h1>
      <br/>
     <p> This is the Content </p>
     <button className="btn">
     <DeleteOutlineIcon className="deleteIcon"/>
     </button>

      </div>
      </>
    );
};

export default Note;
